import React from 'react';
import { useState } from 'react';

const Counter = () => {
    const [x,setX] = useState(0);
    let isLogedIn = false;
    return (
        <div>
            <h1>Count X:{x}</h1>
            <button onClick={()=>setX(x+1)}>Inc</button>
            <button onClick={()=>setX(x-1)}>Dec</button>
        </div>
    )
}

export default Counter
